bioghist.p:
Ter bereiking van haar doel was de stichting bevoegd:

onroerende goederen, voor zover het landelijke eigendommen betreft met bijbehorende bedrijfsinventaris, in eigendom te verkrijgen of  zodanige goederen in administratie te nemen;

de verkregen onroerende goederen te vervreemden en te bezwaren en zolang zij niet vervreemd zijn, die goederen te beheren;

schulden aan te gaan en over te nemen;

voorschotten te geven op de bijdragen in bezettingsschaden;

alle handelingen te verrichten welke ter bereiking van het doel der stichting nuttig of nodig zijn.

De geldmiddelen die nodig waren ter bereiking van het doel verschafte de stichting zich:

door het verkrijgen van rentedragende of renteloze voorschotten uit 's Rijks schatkist;

door de opbrengsten van de door haar in eigendom verkregen goederen;

uit het batig saldo van de in administratie genomen goederen;

door subsidies en dotaties.

Omstreeks 1977 waren er een aantal redenen om de statuten opnieuw aan te passen:

Het besluit van de minister van Landbouw en Visserij om de SBL met de ten uitvoerlegging van de regeling betreffende de beheersovereenkomsten te belasten;

Het besluit van de regering om de aankoop van landbouwgronden ten behoeve van reservaatsvorming te doen geschieden door de SBL;

De nieuwe wettelijke bepalingen ten aanzien van stichtingen in het nieuwe Burgerlijk Wetboek;

De veranderde positie van voor overheidsstichtingen werkzame personen op grond van de nieuwe Pensioenwet en de opvattingen van de pensioenraad terzake.

scopecontent.p:
Verder bevat het archief  bescheiden over de volgende zaken:

de overgave van vorderingen gedaan door de SLB aan de SBL;

vorderingen gedaan door de SBL ten behoeve van herstelwerkzaamheden, het herinrichten en het opheffen van vliegvelden;

het vorderen van grond en de ruilverkaveling als gevolg van herstelwerkzaamheden van aangelegde tankvallen en -grachten en onderwaterzetting;

het vorderen van grond voor de aanleg van militaire begraafplaatsen.
          In de dossiers bevinden zich veel kaarten, die een overzicht geven van de vorderingen die zijn gedaan tijdens en na de oorlog.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
